SELECT DISTINCT ?item ?itemLabel ?itemDescription ( COUNT ( DISTINCT ?wikisource ) as ?wikisourceFullWork ) ( COUNT ( DISTINCT ?iaID ) as ?iaDownloads ) ( COUNT ( DISTINCT ?download ) as ?otherDownloads ) 
WHERE 
{  
  { SELECT DISTINCT ?item 
   WHERE
     { 
       VALUES ?languages { "es" "en" }.                                                                                                           
       ?item ( wdt:P170 | wdt:P50 | wdt:P57 | wdt:P58 | wdt:P84 | wdt:P86 | wdt:P87 | wdt:P110 | wdt:P676 | wdt:P943 | wd:P175 | wd:P9191 | wd:P10837 ) wd:Q57223579 . 
       ?item rdfs:label ?itemLabel .
       FILTER ( LANG( ?itemLabel ) = ?languages ) . 
       MINUS { 
         VALUES ?typeOfItem { wd:Q3658341 wd:Q187931 wd:Q3375722 } 
         ?item wdt:P31 ?typeOfItem . } 
     } 
  }   
  OPTIONAL { ?item wdt:P724 ?iaID . }
  OPTIONAL { ?item wdt:P953 ?download . }
  OPTIONAL {
  ?wikisource schema:about ?item .
  ?wikisource schema:isPartOf <https://es.wikisource.org/> . }  
  SERVICE wikibase:label { bd:serviceParam wikibase:language "es, en" . } 
} 
GROUP BY ?item ?itemLabel ?itemDescription 
ORDER BY ASC ( ?itemLabel )

SELECT ?item (?itemLabel as ?title)    ?imdb ?article ?instanceofLabel 

(GROUP_CONCAT(DISTINCT ?actorLabel; SEPARATOR="|") AS ?actors)
(GROUP_CONCAT(DISTINCT ?directorLabel; SEPARATOR="|") AS ?directors)
(GROUP_CONCAT(DISTINCT ?releasedate; SEPARATOR="|") AS ?releasedates)

WHERE {
  ?item wdt:P345 ?imdb .
  FILTER(?imdb = "tt6148376")

  #?item wdt:P31 wd:Q11424 .                      #instance of a Film
  ?item wdt:P31 ?instanceof .

  OPTIONAL {?item wdt:P577 ?releasedate.} 
  OPTIONAL {?item wdt:P57 ?director. }
  OPTIONAL {?item wdt:P161 ?actor. }

  OPTIONAL { 
      ?article schema:about ?item .
      ?article schema:inLanguage "en" .
      ?article schema:isPartOf <https://en.wikipedia.org/> .
    }

  SERVICE wikibase:label { bd:serviceParam wikibase:language "en". 
       ?director rdfs:label ?directorLabel.
       ?actor rdfs:label ?actorLabel.
       ?item rdfs:label ?itemLabel.
       ?instanceof rdfs:label ?instanceofLabel.
  }

}
GROUP BY ?item ?itemLabel ?imdb ?article ?instanceofLabel

SELECT ?property ?propertyLabel ?value ?valueLabel ?qualifier ?qualifierLabel ?qualifierValue ?qualifierValueLabel WHERE {
      wd:P4188 ?p ?statement .
      ?statement ?ps ?value .
      ?property wikibase:claim ?p;
                wikibase:statementProperty ?ps.

      # Exclude 'described by source' (P1343) from both claim and statement properties
      FILTER(?p != wdt:P1343 && ?ps != wdt:P1343)

      # Exclude all identifiers
      FILTER NOT EXISTS {
          ?property wdt:P31/wdt:P279* wd:Q19847637.
      }

      OPTIONAL {
          ?statement ?pq ?qualifierValue .
          ?qualifier wikibase:qualifier ?pq .
      }

      SERVICE wikibase:label { bd:serviceParam wikibase:language '[AUTO_LANGUAGE],en'. }
    }

SELECT DISTINCT ?item ?itemLabel ?commonsSiteLink ?commonsCat WHERE {
  { ?item rdfs:label 'Kerry'@en } UNION { ?item skos:altLabel 'Kerry'@en }
  FILTER NOT EXISTS { ?item wdt:P31 wd:Q17362920 } .# ignore Wikimedia duplicated page
  OPTIONAL { ?commonsSiteLink schema:about ?item ;
             schema:isPartOf <https://commons.wikimedia.org/> }
  OPTIONAL { ?item wdt:P373 ?commonsCat }
  ?item wdt:P625 ?coords .

  FILTER(geof:distance(?coords, "Point(-9.237117284075852 52.04448094604852)"^^geo:wktLiteral) < 10)
  FILTER(?commonsCat || ?commonsSiteLink)

  SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}

